import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Profile = () => {
    const [profilePhoto, setProfilePhoto] = useState(null);

    const handlePhotoUpload = (event) => {
        setProfilePhoto(URL.createObjectURL(event.target.files[0]));
    };

    return (
        <div className="container mt-5">
            {/* Navbar Section */}
            <nav className="navbar navbar-expand-lg navbar-light bg-light">
                <a className="navbar-brand" href="/">Job Application</a>
                <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                    <span className="navbar-toggler-icon"></span>
                </button>
            </nav>

            {/* Profile Photo Section */}
            <div className="text-center mt-4">
                <h3>Profile Photo</h3>
                {profilePhoto ? (
                    <img src={profilePhoto} alt="Profile" className="rounded-circle" width="150" height="150" />
                ) : (
                    <div className="d-flex flex-column align-items-center">
                        <p>No photo uploaded yet</p>
                        <input type="file" onChange={handlePhotoUpload} className="form-control w-50" />
                    </div>
                )}
            </div>

            {/* Bio Section */}
            <section className="mt-5">
                <h3>Bio</h3>
                <textarea className="form-control" rows="4" placeholder="Tell us about yourself"></textarea>
            </section>

            {/* Interests, Skills, and Skill Matching Section */}
            <div className="row mt-5">
                <div className="col-md-4">
                    <h4>Your Interests</h4>
                    <textarea className="form-control" rows="4" placeholder="List your interests"></textarea>
                </div>
                <div className="col-md-4">
                    <h4>Your Skills</h4>
                    <textarea className="form-control" rows="4" placeholder="List your skills"></textarea>
                </div>
                <div className="col-md-4">
                    <h4>Skill Matching</h4>
                    <textarea className="form-control" rows="4" placeholder="Match your skills"></textarea>
                </div>
            </div>

            {/* Experience Section */}
            <section className="mt-5">
                <h3>Experience</h3>
                <textarea className="form-control" rows="4" placeholder="Add your career experience"></textarea>
            </section>

            {/* Education Section */}
            <section className="mt-5">
                <h3>Education</h3>
                <textarea className="form-control" rows="4" placeholder="Add your educational background"></textarea>
            </section>

            {/* Certifications and Awards Section */}
            <section className="mt-5">
                <h3>Certifications and Awards</h3>
                <textarea className="form-control" rows="4" placeholder="List your certifications and awards"></textarea>
            </section>

            {/* Projects Section */}
            <section className="mt-5">
                <h3>Projects</h3>
                <textarea className="form-control" rows="4" placeholder="List your projects"></textarea>
            </section>

            {/* Letter of Recommendations Section */}
            <section className="mt-5">
                <h3>Letter of Recommendations</h3>
                <textarea className="form-control" rows="4" placeholder="Add letters of recommendation"></textarea>
            </section>

            {/* Publications Section */}
            <section className="mt-5">
                <h3>Publications</h3>
                <textarea className="form-control" rows="4" placeholder="Add your publications"></textarea>
            </section>

            {/* Resume Builder Button */}
            <div className="text-center mt-5">
                <button className="btn btn-primary">Build Your Resume</button>
            </div>

            {/* Footer Section */}
            <footer className="mt-5 text-center">
                <p>&copy; 2024 Job Application Website. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default Profile;
